import React from "react";
import { Navbar, Nav } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHome, faUser } from "@fortawesome/free-solid-svg-icons";
import { Link, useHistory } from "react-router-dom";
import Utils from "../utils/Utils";
import BackendService from "../services/BackendService";
import { useDispatch, useSelector } from "react-redux";
import { userActions } from "../utils/Rdx";

const NavigationBar = () => {
  const dispatch = useDispatch();
  const history = useHistory();
  const user = useSelector((state) => state.authentication.user);

  const goHome = () => {
    history.push("AnotherHome");
  };

  const logout = () => {
    BackendService.logout().then(() => {
      Utils.removeUser();
      dispatch(userActions.logout());
      history.push("/login");
    });
  };

  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand>
        <FontAwesomeIcon icon={faHome} /> My RPO
      </Navbar.Brand>
      <Navbar.Brand>myRPO</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ms-auto">
          {/*<Nav.Link href="/home">Home</Nav.Link>*/}
          <Nav.Link as={Link} to="/home">
            Home
          </Nav.Link>
          <Nav.Link onClick={goHome}>Another home</Nav.Link>
          <Nav.Link onClick={() => history.push("/home")}>
            Yet another home
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
      <Navbar.Text>{user && user.login}</Navbar.Text>
      {user && (
        <Nav.Link onClick={logout}>
          <FontAwesomeIcon icon={faUser} fixedWidth /> Выход
        </Nav.Link>
      )}
      {!user && (
        <Nav.Link as={Link} to="/login">
          <FontAwesomeIcon icon={faUser} fixedWidth /> Вход
        </Nav.Link>
      )}
    </Navbar>
  );
};

export default NavigationBar;
